import { Component } from 'react';



class Step5 extends Component{

    
    componentDidMount() {
        this.handleScroll()
    }

    render(){
        return(
            <div className="sheet">
                <h1 className='bold'>Step 5: Making a plan for practice</h1>
                <div id="step5" className='container_for_small_margin'>
                    <p>
                        When we checked in earlier, you said you were feeling <span className='underline_text'>{this.getValue('text_box_number_1_step_1_sheet_10')}</span>.
                        <br/><br/>
                        Let's think about how you feel again. It's good to think about how you are feeling after you do a coping strategy to see if using the coping strategy changed how you feel.
                    </p>
                
                    <div id="instruction_box_number_1_step_3_sheet_10" className="custom_svg demo_box container_for_extra_small_margin">
                        <p className='top_line_in_instruction_box other_text_in_instruction_box'>
                            Help your mentee review their body scan worksheet or mood log.<br/>
                            Put the link in the chat and ask your mentee to screen share
                        </p>
                    </div>
                
                    
                </div>
            </div>
            
        )
    }
}

export default Step5;
